import io
import sys

# 下記に標準入力を記載
_INPUT = """\
vnxml
cweoibcv
bdsgaubla


"""
sys.stdin = io.StringIO(_INPUT)
# ここからコードを記載
N = [input() for i in range(4)]
num = N[-1]
words = N[:3]
word = ""

for _ in range(len(num)):
    if num == "":
        exit
    elif num[0] == "1":
        word += words[0]
    elif num[0] == "2":
        word += words[1]
    elif num[0] == "3":
        word += words[2]
    num = num[1:]
print(word)
